import './index.scss';
import Sidebar from '../Sidebar';
import { Outlet } from 'react-router-dom';

const Layout = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <h1>Hi</h1>
            </div>
        </div>
    )
}

export default Layout;
